import React from 'react'

const ChatBox = (props) => {
  const { messages } = props
  console.log(messages)
  return (
    <div className='chat-box'>
      <div className='messages'>
        {
          messages.map(message => <p>{message.msg}</p>)
        }
      </div>
    </div>
  )
}

export default ChatBox
